// MatCap-style image rendered on a sphere
// modify sphere UVs instead of using a ShaderMaterial

var camera, scene, renderer;
var image1;
var image2;
var light1, light2;
var angle = 0;
var isMobile = false;

init();
animate();

function init() {

    if (/Mobi/.test(navigator.userAgent)) {
    	isMobile = true;
	} 

	renderer = new THREE.WebGLRenderer({ antialias: false,alpha:true });
	renderer.setSize( window.innerWidth, window.innerHeight );
	renderer.setClearColor(0x000000, 0);
	document.body.appendChild( renderer.domElement );
	scene = new THREE.Scene();
	
	camera = new THREE.PerspectiveCamera( 40, window.innerWidth / window.innerHeight, .1, 3000 );
	camera.position.set( 200, 0, 1000 );
    scene.add( camera ); // since light is child of camera

	controls = new THREE.OrbitControls( camera );
	controls.minDistance = 20;
	controls.maxDistance = 1300;
    controls.enablePan = false;

	scene.add( new THREE.AmbientLight( 0xffffff, .001 ) );
	
	light1 = new THREE.SpotLight( 0xffffff, 1 );
	light1.position.set(0,0,0);
	light2 = new THREE.SpotLight( 0xffffff, 2 );
	light2.position.set(0,60,0);
	camera.add(light1);
	scene.add(light2);

    image1 = document.createElement( 'img' );
    document.body.appendChild( image1 );
    image2 = document.createElement( 'img' );
    document.body.appendChild( image2 );

    var texture1 = new THREE.Texture( image1 );
    var texture2 = new THREE.Texture( image2 );
    image1.addEventListener( 'load', function ( event ) { texture1.needsUpdate = true; } );
    image2.addEventListener( 'load', function ( event ) { texture2.needsUpdate = true; } );

	var material1 = new THREE.MeshPhongMaterial( {
		color: 0xeeeeee, 
		specular: 0x111111,
		shininess: 0.002,
		map: texture1
	} );

	var material2 = new THREE.MeshPhongMaterial( {
		color: 0xeeeeee, 
		specular: 0x000000,
		shininess: 0.001,
		map: texture2
	} );

	var sphere_scale = 1.5;
	var geometry1 = new THREE.SphereGeometry( 30 * sphere_scale, 32 * sphere_scale, 16  * sphere_scale);
	var geometry2 = new THREE.SphereGeometry( 30 * sphere_scale, 32 * sphere_scale, 16  * sphere_scale);

    // modify UVs to accommodate MatCap texture
	var faceVertexUvs1 = geometry1.faceVertexUvs[ 0 ];
	for ( i = 0; i < faceVertexUvs1.length; i ++ ) {
		var uvs = faceVertexUvs1[ i ];
		var face = geometry1.faces[ i ];
		for ( var j = 0; j < 3; j ++ ) {
			uvs[ j ].x = face.vertexNormals[ j ].x * 0.5 + 0.5;
			uvs[ j ].y = face.vertexNormals[ j ].y * 0.5 + 0.5;
		}
	}

	var faceVertexUvs2 = geometry2.faceVertexUvs[ 0 ];
	for ( i = 0; i < faceVertexUvs2.length; i ++ ) {
		var uvs = faceVertexUvs2[ i ];
		var face = geometry2.faces[ i ];
		for ( var j = 0; j < 3; j ++ ) {
			uvs[ j ].x = face.vertexNormals[ j ].x * 0.5 + 0.5;
			uvs[ j ].y = face.vertexNormals[ j ].y * 0.5 + 0.5;
		}
	}

    mesh1 = new THREE.Mesh( geometry1, material1 );
    mesh2 = new THREE.Mesh( geometry2, material2 );
    
	scene.add(mesh1);
	scene.add(mesh2);
	mesh1.position = new THREE.Vector3(0, 0, 0);
	mesh2.position = new THREE.Vector3(0, 0, 0);

	mesh1.position.setZ(-50);  
	mesh2.position.setZ(50);
	
	loadFont();

	var from = {
            x: camera.position.x,
            y: camera.position.y,
            z: camera.position.z
        };

    var to = {
        x: 100,
        y: 0,
        z: 0
    };

	var tween = new TWEEN.Tween(from)
	    .to(to, 3600)
	    .easing(TWEEN.Easing.Linear.None)
	    .onUpdate(function () {
	    camera.position.set(this.x, this.y, this.z);
	    camera.lookAt(new THREE.Vector3(0, 0, 0));
	})
	    .onComplete(function () {
	    camera.lookAt(new THREE.Vector3(0, 0, 0));
	    setTimeout(function(){

	    var to = {
	        x: isMobile ? 1500 : 500,
	        y: camera.position.y + 85,
	        z: isMobile ? camera.position.z + 1000 : camera.position.z + 200
	    };
		var tween = new TWEEN.Tween(from)
		    .to(to, 2000)
		    .easing(TWEEN.Easing.Linear.None)
		    .onUpdate(function () {
		    camera.position.set(this.x, this.y, this.z);
		    camera.lookAt(new THREE.Vector3(0, 0, 0));
		})
		    .onComplete(function () {
		    camera.lookAt(new THREE.Vector3(0, 0, 0));
		})
		    .start();
	    }, 400);
	})
	    .start();

}

function loadFont() {
	var loader = new THREE.FontLoader();
	var result;
	loader.load( 'fonts/' + 'helvetiker_bold.typeface.js', function ( response ) {
		font = response;
		addText("LITTLE CINEMA No. 10", {x: -520, y:100, z:370}, isMobile ? 70 : 112, 1.67);
		addText("THE FIFTH ELEMENT", {x:-280, y:0, z:125}, isMobile ? 41 : 81, 1.62);
		addText("IMMERSIVE", {x:-180, y:-20, z:-205}, isMobile ? 16 : 36, 1.62);
		addText("HOUSE OF YES", {x:-180, y:-60, z:325}, isMobile ? 11 : 21, 1.6);
		addText("MARCH 29, 8PM", {x:-180, y:-90, z:-235}, isMobile ? 16 : 34, 1.5);
		addText("AFTERPARTY", {x:-180, y:-130, z:-285}, isMobile ? 11 : 16, 1.6);
	} );
}

function addText(text, position, size, rotation){
  var shape = new THREE.TextGeometry(text, {font: font, size: size, bevelThickness: 0.3, bevelSize: 0.6});
  var wrapper = text == "THE FIFTH ELEMENT" ? new THREE.MeshPhongMaterial({color: 0xff7200}) : new THREE.MeshPhongMaterial({color: 0x5FA1CA});
  //var wrapper = text == "THE FIFTH ELEMENT" ? new THREE.MeshPhongMaterial({color: 0xFA7A4C}) : new THREE.MeshPhongMaterial({color: 0x5FA1CA});
  var words = new THREE.Mesh(shape, wrapper);
  words.position.set(position.x,position.y,position.z);
  words.rotation.y += rotation;
  scene.add(words);
}


function animate() {
	 TWEEN.update();
	//mesh1.rotation.x = (23.5/180)*Math.PI;
    mesh1.rotation.y = Date.now() * 0.0003;
    mesh2.rotation.y = Date.now() * 0.0005;
    angle -= 0.01;
  
  	light2.position.x = 200+1000*Math.sin(angle);
  	light2.position.z = 200+1000*Math.cos(angle);
	requestAnimationFrame(animate);

	//controls.update(); // not required here

	

	render();

}

function render() {

	renderer.render( scene, camera );

}

image1.src = 'data:image/jpeg;base64,';
image2.src = 'data:image/jpeg;base64,';
